(207, '_transient_dash_f69de0bbfe7eaa113146875f40c02000', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2016/10/join-us-again-for-global-wordpress-translation-day/''>Join Us Again for Global WordPress Translation Day</a> <span class="rss-date">14.10.2016</span><div class="rssSummary">The WordPress Polyglots team is organizing the second Global WordPress Translation Day on November 12th. Everyone is invited to join – from anywhere in the world! Translating is one of the easiest ways to get involved with WordPress and contribute to the project. Global WordPress Translation Day is your chance to learn more about translating WordPress, meet [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://ma.tt/2016/10/common-at-tiny-desk/''>Matt: Common at Tiny Desk</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/wordpress-4-7-to-introduce-user-specific-language-setting-for-the-admin''>WPTavern: WordPress 4.7 to Introduce User-Specific Language Setting for the Admin</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/linkedin-learning-is-offering-free-access-this-week-to-its-library-of-more-than-5000-courses''>WPTavern: LinkedIn Learning Is Offering Free Access This Week to Its Library of More Than 5,000 Courses</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Популярный плагин:</span> Clef Two-Factor Authentication&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=wpclef&amp;_wpnonce=1c91d1f161&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Установить Clef Two-Factor Authentication">(Установить)</a></li></ul></div>', 'no');
